import React from 'react';

import ThumbsUp from '../Assets/img/thumbs-up.svg';
import ThumbsDown from '../Assets/img/thumbs-down.svg';

function Tweet () {
    return (
        <div className="tweet">
            <div className="tweetRow1">
                <div className="tweetTitle">Name</div>
                <div className="tweetLikes">
                    <div>{ ThumbsUp }</div>
                    <div>Total dislikes: </div>
                </div>
            </div>
            <div className="tweetRow2">
                <div className="tweetDate">24.4.2020</div>
                <div className="tweetDelete">Delete tweet</div>
            </div>
            <div className="tweetText">TweetTextTweetTextTweetTextTweetTextTweetTextTweetText</div>
        </div>
    );
}

export default Tweet;
